import React from 'react';
import {Text} from 'react-native';

const getFullName = (primerNombre, segundoNombre, tercerNombre) => {
  return primerNombre + " " + segundoNombre + " " + tercerNombre;
}

const Gato = () => {
  const nombre = "Michi";
  return <Text>Hola, soy {getFullName('Michi', 'Michito' ,
  'Michifuz')}!</Text>;
}

export default Gato;
